import LogRegForGet from '@/pages/user/LogRegForGet'; //import AuthenticationService from '@/services/AuthenticationService'

export default {
  components: {
    LogRegForGet: LogRegForGet
  },
  data: function data() {
    return {
      activeLoading: false
    };
  },
  computed: {
    i18n_locale_img: function i18n_locale_img() {
      return require("@/assets/images/flags/".concat(this.$i18n.locale, ".png"));
    },
    getCurrentLocaleData: function getCurrentLocaleData() {
      var locale = this.$i18n.locale;
      if (locale == "vi") return {
        flag: "vi",
        lang: 'Tiếng Việt'
      };else if (locale == "en") return {
        flag: "us",
        lang: 'English'
      };else if (locale == "pt") return {
        flag: "br",
        lang: 'Portuguese'
      };else if (locale == "fr") return {
        flag: "fr",
        lang: 'French'
      };else if (locale == "de") return {
        flag: "de",
        lang: 'German'
      };
    }
  },
  methods: {
    updateLocale: function updateLocale(locale) {
      this.$i18n.locale = locale;
    },
    LoginUrl: function LoginUrl() {
      this.$router.push({
        path: '/login'
      });
    },
    RegisterUrl: function RegisterUrl() {
      this.$router.push({
        path: '/register'
      });
    },
    onWindowLoad: function onWindowLoad() {
      var path = this.$router.currentRoute.path;
      var checkTK = localStorage.hasOwnProperty('tokenUser');

      if (path == '/' && checkTK) {
        this.$router.push({
          path: '/trading'
        });
      } //this.activeLoading = false
      //this.$vs.loading.close()

    }
  },
  created: function created() {
    window.addEventListener("load", this.onWindowLoad);
  }
};
